import json

from sitralib.helpers.funciones import *


class CompilaRespuestaProgramaTiempos:
  def __init__(self, tramas):
    self.helpers = Helpers()
    self.trm = tramas

  def compile(self):
    programa_tiempos = self.helpers.tramas_by_codigo(
      tramas=self.trm,
      codigo='D5'
    )
    programas = {}

    for i in programa_tiempos:
      n = '20' if '20' in i else 20
      programas.update(
        {self.helpers.hexToDec(i[n]): self.__programa(i)}
      )

    return programas

  def __programa(self, programas):

    v = {
      'espDesfasaje': self.__desfasafe(programas),
      'espCiclo': self.__duracion_ciclo(programas),
      'espSup': self.__tiempo_suplementario(programas),
      'espData': self.__tiempos_intervalos(programas)
    }
    return v

  def __tiempos_intervalos(self, programas):
    """
    Obtiene los intervalos de tiempo
    :param programas: dict
    :return: list
    """
    a = []

    if programas:
      for i in range(21, 57):
        valor = programas[i] if i in programas else programas[
          str(i)]
        a.append(self.helpers.hexToDec(valor))
    return a

  def __desfasafe(self, programas):
    """
    Obtiene el tiempo de desfasaje
    :param programas: dict
    :return: int
    """

    try:
      msb = programas['61'] if '61' in programas else programas[61]
      lsb = programas['62'] if '62' in programas else programas[62]
      valor = msb + lsb
      return self.helpers.hexToDec(valor)
    except Exception as e:
      print(e)

  def __tiempo_suplementario(self, programas):
    """
    Obtiene el tiempo suplementario
    :param programas: dict
    :return: int
    """
    try:
      msb = programas['59'] if '59' in programas else programas[59]
      lsb = programas['60'] if '60' in programas else programas[60]
      valor = msb + lsb
      return self.helpers.hexToDec(valor)

    except Exception as e:
      print(e)

  def __duracion_ciclo(self, programas):
    """
    Duraci√≥n del ciclo
    :param programas: dict
    :return: int
    """
    try:
      msb = programas['57'] if '57' in programas else programas[57]
      lsb = programas['58'] if '58' in programas else programas[58]
      valor = msb + lsb
      return self.helpers.hexToDec(valor)
    except Exception as e:
      print(e)


